webpackJsonp([0xca43e4bf588d],{338:function(a,t){a.exports={data:{markdownRemark:{html:'<p>Google Cloud Platform honestly has too many features for me to keep up with. This feature called Datastore is quite useful for storage in creating highly scalable apps.</p>\n<h4>What is it?</h4>\n<p>It\'s a NoSQL style database. It automatically handles things like <a href="https://en.wikipedia.org/wiki/Shard_(database_architecture)">sharding</a> and replication and so its highly available, durable and will automatically scale to handle the realtime load of an app. It offers a few ways of doing business like SQL-like querying, <a href="https://en.wikipedia.org/wiki/ACID">ACID</a> (atomic, consistent, isolated, durable) transactions, and indexes.</p>\n<div class="note">\n  <strong>Note:</strong> Datastore is already on the way out! Soon all datastores will be automatically upgraded to Firestore, a faster more consistent solution.\n</div>\n<h4>When to use it</h4>',frontmatter:{date:"July 06, 2021",path:"/gcp-datastore",title:"Build scalably with GCP Datastore"}}},pathContext:{}}}});
